                if (this.LogEntries.Specific != null)
                {
                    foreach (var item in this.LogEntries.Specific)
                    {
                        if (!eval(item.Overall)) return false;
                        if (item.Specific != null && !item.Specific.AllEqual(eval)) return false;
                    }
